import "./App.css";
//import "./Home.css";
import React from "react";
import Auth from './Login/auth';
import Cookies  from 'universal-cookie';
import members from './members';
//import vp
//import sec
import { siteData } from "./info/data";


function HomeInfo() {
  return( 
    <div class = 'home-container'>
      <div class="container-fluid" id = "aboutus-info-container">
        <div class="col-md-12">
            <div class="jumbotron">
              <h2>
                {siteData.homePage.clubInfo.about.header}
              </h2>
              <p>
              {siteData.homePage.clubInfo.about.body}
              </p>
            </div>
        </div>
    </div>
    <div class = "container-fluid">
       {members()}
   </div>
  
  </div>
  
  )
}

function Nav() {
  const cookies = new Cookies();
  const isAuth = cookies.get('isAuth') == 'true';
  if (isAuth)
  {
    return (
      <div class = 'cotainer-fluid'>
        <nav>
          <div class="form-check form-check-inline nowrap">
            <a class="nav-link" href="/profile"> Profile</a> |
            <a class="nav-link" href="/calendar"> Calendar</a> |
            <a class="nav-link" href="/signout"> Sign Out</a>
          </div>  
        </nav>
      </div>  
    )
  }
  return (
    <div class = 'cotainer-fluid'>
      <nav>
        <a class="nav-link" href="/login"> Log In</a> 
      </nav>
    </div>
    )
}

function Home() {
  return (
    <div class="home-container">
      <Nav />
      <HomeInfo />
    </div>
  );
}

export default Home;
